import { useState } from "react";
import DisplayBooks from "./components/DisplayBooks";
import InputBookForm from "./components/InputBookForm";

function App() {

  const [db, setdb] = useState(false);

  const pushedToDB = () => {
    setdb(!db);
  };

  return (
    <div className="App">
      <h1>library</h1>
      <InputBookForm onPush={pushedToDB}/>
      <DisplayBooks/>
    </div>
  );
}

export default App;
